(2221, 'refund_terms_page', '', '<h1>Refund policy</h1>\n<p>Since the Service offers non-tangible, irrevocable goods we do not provide refunds after the product is purchased, which you acknowledge prior to purchasing any product on the Services. Please make sure that youve carefully read service description before making a purchase.</p>\n<h2>Contacting us</h2>\n<p>If you have any questions, concerns, or complaints regarding this refund policy, we encourage you to contact us using the details below:</p>\n<p><a href=\"https://www.fitlynk.com/contact-us\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https://www.fitlynk.com/contact-us</a></p>\n<p>This document was last updated on June 23, 2022</p>', '&lt;H4&gt; 1-      . &lt;/ H4&gt;'),
