(2295, 'cookie_policy', '', '<h1>Cookie policy</h1>\n<p>This cookie policy (Policy) describes what cookies are and how and they\'re being used by the <a href=\"https://www.fitlynk.com\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">fitlynk.com</a> website (Website or Service) and any of its related products and services (collectively, Services). This Policy is a legally binding agreement between you (User, you or your) and FitLynk FZ-LLC (doing business as FitLynk, we, us or our). If you are entering into this agreement on behalf of a business or other legal entity, you represent that you have the authority to bind such entity to this agreement, in which case the terms User, you or your shall refer to such entity. If you do not have such authority, or if you do not agree with the terms of this agreement, you must not accept this agreement and may not access and use the Website and Services. You should read this Policy so you can understand the types of cookies we use, the information we collect using cookies and how that information is used. It also describes the choices available to you regarding accepting or declining the use of cookies.</p>\n<h2>What are cookies?</h2>\n<p>Cookies are small pieces of data stored in text files that are saved on your computer or other devices when websites are loaded in a browser. They are widely used to remember you and your preferences, either for a single visit (through a \"session cookie\") or for multiple repeat visits (using a \"persistent cookie\").</p>\n<p>Session cookies are temporary cookies that are used during the course of your visit to the Website, and they expire when you close the web browser.</p>\n<p>Persistent cookies are used to remember your preferences within our Website and remain on your desktop or mobile device even after you close your browser or restart your computer. They ensure a consistent and efficient experience for you while visiting the Website and Services.</p>\n<p>Cookies may be set by the Website (\"first-party cookies\"), or by third parties, such as those who serve content or provide advertising or analytics services on the Website (\"third party cookies\"). These third parties can recognize you when you visit our website and also when you visit certain other websites. You may learn more about cookies and how they work in this <a href=\"https://www.websitepolicies.com/blog/cookies\" target=\"_blank\" rel=\"noopener noreferrer\">guide</a>.</p>\n<h2>What type of cookies do we use?</h2>\n<h3>Necessary cookies</h3>\n<p>Necessary cookies allow us to offer you the best possible experience when accessing and navigating through our Website and using its features. For example, these cookies let us recognize that you have created an account and have logged into that account to access the content.</p>\n<h3>Functionality cookies</h3>\n<p>Functionality cookies let us operate the Website and Services in accordance with the choices you make. For example, we will recognize your username and remember how you customized the Website and Services during future visits.</p>\n<h3>Analytical cookies</h3>\n<p>These cookies enable us and third party services to collect aggregated data for statistical purposes on how our visitors use the Website. These cookies do not contain personal information such as names and email addresses and are used to help us improve your user experience of the Website.</p>\n<h3>Advertising cookies</h3>\n<p>Advertising cookies allow us and third parties serve relevant ads to you more effectively and help us collect aggregated audit data, research, and performance reporting for advertisers. They also enable us to understand and improve the delivery of ads to you and know when certain ads have been shown to you.</p>\n<p>Your web browser may request advertisements directly from ad network servers, these networks can view, edit, or set their own cookies, just as if you had requested a web page from their website.</p>\n<p>Although we do not use cookies to create a profile of your browsing behavior on third party websites, we do use aggregate data from third parties to show you relevant, interest-based advertising. We do not provide any personal information that we collect to advertisers.</p>\n<h3>Social media cookies</h3>\n<p>Third party cookies from social media sites (such as Facebook, Twitter, etc) let us track social network users when they visit or use the Website and Services, or share content, by using a tagging mechanism provided by those social networks.</p>\n<p>These cookies are also used for event tracking and remarketing purposes. Any data collected with these tags will be used in accordance with our and social networks privacy policies. We will not collect or share any personally identifiable information from the user.</p>\n<h2>Do we use web beacons or tracking pixels?</h2>\n<p>Our emails may contain a \"web beacon\" (or \"tracking pixel\") to tell us whether our emails are opened and verify any clicks through to links or advertisements within the email.</p>\n<p>We may use this information for purposes including determining which of our emails are more interesting to users and to query whether users who do not open our emails wish to continue receiving them.</p>\n<p>The pixel will be deleted when you delete the email. If you do not wish the pixel to be downloaded to your device, you should read the email in plain text view or with images disabled.</p>\n<h2>What are your cookie options?</h2>\n<p>If you dont like the idea of cookies or certain types of cookies, you can change your browsers settings to delete cookies that have already been set and to not accept new cookies. To learn more about how to do this, visit <a href=\"https://www.internetcookies.com\" target=\"_blank\" rel=\"noopener noreferrer\">internetcookies.com</a></p>\n<p>Please note, however, that if you delete cookies or do not accept them, you might not be able to use all of the features the Website and Services offer.</p>\n<h2>Changes and amendments</h2>\n<p>We reserve the right to modify this Policy or its terms related to the Website and Services at any time at our discretion. When we do, we will revise the updated date at the bottom of this page. We may also provide notice to you in other ways at our discretion, such as through the contact information you have provided.</p>\n<p>An updated version of this Policy will be effective immediately upon the posting of the revised Policy unless otherwise specified. Your continued use of the Website and Services after the effective date of the revised Policy (or such other act specified at that time) will constitute your consent to those changes.</p>\n<h2>Acceptance of this policy</h2>\n<p>You acknowledge that you have read this Policy and agree to all its terms and conditions. By accessing and using the Website and Services you agree to be bound by this Policy. If you do not agree to abide by the terms of this Policy, you are not authorized to access or use the Website and Services.</p>\n<h2>Contacting us</h2>\n<p>If you have any questions, concerns, or complaints regarding this Policy or the use of cookies, we encourage you to contact us using the details below:</p>\n<p><a href=\"https://www.fitlynk.com/contact-us\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https://www.fitlynk.com/contact-us</a></p>\n<p>This document was last updated on June 23, 2022</p>', '&lt;h1&gt;Cookie policy&lt;/h1&gt; <br>&lt;p&gt;This cookie policy (Policy) describes what cookies are and how and they&#039;re being used by the &lt;a href=&quot;https://www.fitlynk.com&quot; target=&quot;_blank&quot; rel=&quot;nofollow noopener noreferrer&quot;&gt;fitlynk.com&lt;/a&gt; website (Website or Service) and any of its related products and services (collectively, Services). This Policy is a legally binding agreement between you (User, you or your) and FitLynk FZ-LLC (doing business as FitLynk, we, us or our). If you are entering into this agreement on behalf of a business or other legal entity, you represent that you have the authority to bind such entity to this agreement, in which case the terms User, you or your shall refer to such entity. If you do not have such authority, or if you do not agree with the terms of this agreement, you must not accept this agreement and may not access and use the Website and Services. You should read this Policy so you can understand the types of cookies we use, the information we collect using cookies and how that information is used. It also describes the choices available to you regarding accepting or declining the use of cookies.&lt;/p&gt; <br>&lt;h2&gt;What are cookies?&lt;/h2&gt; <br>&lt;p&gt;Cookies are small pieces of data stored in text files that are saved on your computer or other devices when websites are loaded in a browser. They are widely used to remember you and your preferences, either for a single visit (through a &quot;session cookie&quot;) or for multiple repeat visits (using a &quot;persistent cookie&quot;).&lt;/p&gt; <br>&lt;p&gt;Session cookies are temporary cookies that are used during the course of your visit to the Website, and they expire when you close the web browser.&lt;/p&gt; <br>&lt;p&gt;Persistent cookies are used to remember your preferences within our Website and remain on your desktop or mobile device even after you close your browser or restart your computer. They ensure a consistent and efficient experience for you while visiting the Website and Services.&lt;/p&gt; <br>&lt;p&gt;Cookies may be set by the Website (&quot;first-party cookies&quot;), or by third parties, such as those who serve content or provide advertising or analytics services on the Website (&quot;third party cookies&quot;). These third parties can recognize you when you visit our website and also when you visit certain other websites. You may learn more about cookies and how they work in this &lt;a href=&quot;https://www.websitepolicies.com/blog/cookies&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;guide&lt;/a&gt;.&lt;/p&gt; <br>&lt;h2&gt;What type of cookies do we use?&lt;/h2&gt; <br>&lt;h3&gt;Necessary cookies&lt;/h3&gt; <br>&lt;p&gt;Necessary cookies allow us to offer you the best possible experience when accessing and navigating through our Website and using its features. For example, these cookies let us recognize that you have created an account and have logged into that account to access the content.&lt;/p&gt; <br>&lt;h3&gt;Functionality cookies&lt;/h3&gt; <br>&lt;p&gt;Functionality cookies let us operate the Website and Services in accordance with the choices you make. For example, we will recognize your username and remember how you customized the Website and Services during future visits.&lt;/p&gt; <br>&lt;h3&gt;Analytical cookies&lt;/h3&gt; <br>&lt;p&gt;These cookies enable us and third party services to collect aggregated data for statistical purposes on how our visitors use the Website. These cookies do not contain personal information such as names and email addresses and are used to help us improve your user experience of the Website.&lt;/p&gt; <br>&lt;h3&gt;Advertising cookies&lt;/h3&gt; <br>&lt;p&gt;Advertising cookies allow us and third parties serve relevant ads to you more effectively and help us collect aggregated audit data, research, and performance reporting for advertisers. They also enable us to understand and improve the delivery of ads to you and know when certain ads have been shown to you.&lt;/p&gt; <br>&lt;p&gt;Your web browser may request advertisements directly from ad network servers, these networks can view, edit, or set their own cookies, just as if you had requested a web page from their website.&lt;/p&gt; <br>&lt;p&gt;Although we do not use cookies to create a profile of your browsing behavior on third party websites, we do use aggregate data from third parties to show you relevant, interest-based advertising. We do not provide any personal information that we collect to advertisers.&lt;/p&gt; <br>&lt;h3&gt;Social media cookies&lt;/h3&gt; <br>&lt;p&gt;Third party cookies from social media sites (such as Facebook, Twitter, etc) let us track social network users when they visit or use the Website and Services, or share content, by using a tagging mechanism provided by those social networks.&lt;/p&gt; <br>&lt;p&gt;These cookies are also used for event tracking and remarketing purposes. Any data collected with these tags will be used in accordance with our and social networks privacy policies. We will not collect or share any personally identifiable information from the user.&lt;/p&gt; <br>&lt;h2&gt;Do we use web beacons or tracking pixels?&lt;/h2&gt; <br>&lt;p&gt;Our emails may contain a &quot;web beacon&quot; (or &quot;tracking pixel&quot;) to tell us whether our emails are opened and verify any clicks through to links or advertisements within the email.&lt;/p&gt; <br>&lt;p&gt;We may use this information for purposes including determining which of our emails are more interesting to users and to query whether users who do not open our emails wish to continue receiving them.&lt;/p&gt; <br>&lt;p&gt;The pixel will be deleted when you delete the email. If you do not wish the pixel to be downloaded to your device, you should read the email in plain text view or with images disabled.&lt;/p&gt; <br>&lt;h2&gt;What are your cookie options?&lt;/h2&gt; <br>&lt;p&gt;If you dont like the idea of cookies or certain types of cookies, you can change your browsers settings to delete cookies that have already been set and to not accept new cookies. To learn more about how to do this, visit &lt;a href=&quot;https://www.internetcookies.com&quot; target=&quot;_blank&quot; rel=&quot;noopener noreferrer&quot;&gt;internetcookies.com&lt;/a&gt;&lt;/p&gt; <br>&lt;p&gt;Please note, however, that if you delete cookies or do not accept them, you might not be able to use all of the features the Website and Services offer.&lt;/p&gt; <br>&lt;h2&gt;Changes and amendments&lt;/h2&gt; <br>&lt;p&gt;We reserve the right to modify this Policy or its terms related to the Website and Services at any time at our discretion. When we do, we will revise the updated date at the bottom of this page. We may also provide notice to you in other ways at our discretion, such as through the contact information you have provided.&lt;/p&gt; <br>&lt;p&gt;An updated version of this Policy will be effective immediately upon the posting of the revised Policy unless otherwise specified. Your continued use of the Website and Services after the effective date of the revised Policy (or such other act specified at that time) will constitute your consent to those changes.&lt;/p&gt; <br>&lt;h2&gt;Acceptance of this policy&lt;/h2&gt; <br>&lt;p&gt;You acknowledge that you have read this Policy and agree to all its terms and conditions. By accessing and using the Website and Services you agree to be bound by this Policy. If you do not agree to abide by the terms of this Policy, you are not authorized to access or use the Website and Services.&lt;/p&gt; <br>&lt;h2&gt;Contacting us&lt;/h2&gt; <br>&lt;p&gt;If you have any questions, concerns, or complaints regarding this Policy or the use of cookies, we encourage you to contact us using the details below:&lt;/p&gt; <br>&lt;p&gt;&lt;a href=&quot;https://www.fitlynk.com/contact-us&quot; target=&quot;_blank&quot; rel=&quot;nofollow noopener noreferrer&quot;&gt;https://www.fitlynk.com/contact-us&lt;/a&gt;&lt;/p&gt; <br>&lt;p&gt;This document was last updated on June 23, 2022&lt;/p&gt;'),
(2296, 'use_policy', '', '<h1>Acceptable use policy</h1>\n<p>This acceptable use policy (Policy) sets forth the general guidelines and acceptable and prohibited uses of the <a href=\"https://www.fitlynk.com\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">fitlynk.com</a> website (Website), FitLynk mobile application (Mobile Application) and any of their related products and services (collectively, Services). This Policy is a legally binding agreement between you (User, you or your) and FitLynk FZ-LLC (doing business as FitLynk, we, us or our). If you are entering into this agreement on behalf of a business or other legal entity, you represent that you have the authority to bind such entity to this agreement, in which case the terms User, you or your shall refer to such entity. If you do not have such authority, or if you do not agree with the terms of this agreement, you must not accept this agreement and may not access and use the Services. By accessing and using the Services, you acknowledge that you have read, understood, and agree to be bound by the terms of this Agreement. You acknowledge that this Agreement is a contract between you and FitLynk, even though it is electronic and is not physically signed by you, and it governs your use of the Services.</p>\n<h2>Prohibited activities and uses</h2>\n<p>You may not use the Services to publish content or engage in activity that is illegal under applicable law, that is harmful to others, or that would subject us to liability, including, without limitation, in connection with any of the following, each of which is prohibited under this Policy:</p>\n<ul>\n<li>Distributing malware or other malicious code.</li>\n<li>Disclosing sensitive personal information about others.</li>\n<li>Collecting, or attempting to collect, personal information about third parties without their knowledge or consent.</li>\n<li>Distributing pornography or adult related content.</li>\n<li>Promoting or facilitating prostitution or any escort services.</li>\n<li>Hosting, distributing or linking to child pornography or content that is harmful to minors.</li>\n<li>Promoting or facilitating gambling, violence, terrorist activities or selling weapons or ammunition.</li>\n<li>Engaging in the unlawful distribution of controlled substances, drug contraband or prescription medications.</li>\n<li>Managing payment aggregators or facilitators such as processing payments on behalf of other businesses or charities.</li>\n<li>Facilitating pyramid schemes or other models intended to seek payments from public actors.</li>\n<li>Threatening harm to persons or property or otherwise harassing behavior.</li>\n<li>Manual or automatic credit card or other available payment methods testing using bots or scripts.</li>\n<li>Misrepresenting or fraudulently representing products or services.</li>\n<li>Infringing the intellectual property or other proprietary rights of others.</li>\n<li>Facilitating, aiding, or encouraging any of the above activities through the Services.</li>\n</ul>\n<h2>System abuse</h2>\n<p>Any User in violation of the Services security is subject to criminal and civil liability, as well as immediate account termination. Examples include, but are not limited to the following:</p>\n<ul>\n<li>Use or distribution of tools designed for compromising security of the Services.</li>\n<li>Intentionally or negligently transmitting files containing a computer virus or corrupted data.</li>\n<li>Accessing another network without permission, including to probe or scan for vulnerabilities or breach security or authentication measures.</li>\n<li>Unauthorized scanning or monitoring of data on any network or system without proper authorization of the owner of the system or network.</li>\n</ul>\n<h2>Service resources</h2>\n<p>You may not consume excessive amounts of the resources of the Services or use the Services in any way which results in performance issues or which interrupts the Services for other Users. Prohibited activities that contribute to excessive use, include without limitation:</p>\n<ul>\n<li>Deliberate attempts to overload the Services and broadcast attacks (i.e. denial of service attacks).</li>\n<li>Engaging in any other activities that degrade the usability and performance of the Services.</li>\n</ul>\n<h2>No spam policy</h2>\n<p>You may not use the Services to send spam or bulk unsolicited messages. We maintain a zero tolerance policy for use of the Services in any manner associated with the transmission, distribution or delivery of unsolicited bulk or unsolicited commercial e-mail, or the sending, assisting, or commissioning the transmission of commercial e-mail that does not comply with the U.S. CAN-SPAM Act of 2003 (SPAM).</p>\n<p>Your products or services advertised via SPAM (i.e. Spamvertised) may not be used in conjunction with the Services. This provision includes, but is not limited to, SPAM sent via fax, phone, postal mail, email, instant messaging, or newsgroups.</p>\n<p>Sending emails through the Services to purchased email lists (safe lists) will be treated as SPAM. We may terminate the Service of any User who sends out SPAM with or without notice.</p>\n<h2>Defamation and objectionable content</h2>\n<p>We value the freedom of expression and encourage Users to be respectful with the content they post. We are not a publisher of User content and are not in a position to investigate the veracity of individual defamation claims or to determine whether certain material, which we may find objectionable, should be censored. However, we reserve the right to moderate, disable or remove any content to prevent harm to others or to us or the Services, as determined in our sole discretion.</p>\n<h2>Copyrighted content</h2>\n<p>Copyrighted material must not be published via the Services without the explicit permission of the copyright owner or a person explicitly authorized to give such permission by the copyright owner. Upon receipt of a claim for copyright infringement, or a notice of such violation, we will immediately run full investigation and, upon confirmation, will notify the person or persons responsible for publishing it and, in our sole discretion, will remove the infringing material from the Services. We may terminate the Service of Users with repeated copyright infringements. Further procedures may be carried out if necessary. We will assume no liability to any User of the Services for the removal of any such material. If you believe your copyright is being infringed by a person or persons using the Services, please get in touch with us to report copyright infringement.</p>\n<h2>Security</h2>\n<p>You take full responsibility for maintaining reasonable security precautions for your account. You are responsible for protecting and updating any login account provided to you for the Services.</p>\n<h2>Enforcement</h2>\n<p>We reserve our right to be the sole arbiter in determining the seriousness of each infringement and to immediately take corrective actions, including but not limited to:</p>\n<ul>\n<li>Suspending or terminating your Service with or without notice upon any violation of this Policy. Any violations may also result in the immediate suspension or termination of your account.</li>\n<li>Disabling or removing any content which is prohibited by this Policy, including to prevent harm to others or to us or the Services, as determined by us in our sole discretion.</li>\n<li>Reporting violations to law enforcement as determined by us in our sole discretion.</li>\n<li>A failure to respond to an email from our abuse team within 2 days, or as otherwise specified in the communication to you, may result in the suspension or termination of your account.</li>\n</ul>\n<p>Suspended and terminated User accounts due to violations will not be re-activated.</p>\n<p>Nothing contained in this Policy shall be construed to limit our actions or remedies in any way with respect to any of the prohibited activities. We reserve the right to take any and all additional actions we may deem appropriate with respect to such activities, including without limitation taking action to recover the costs and expenses of identifying offenders and removing them from the Services, and levying cancellation charges to cover our costs. In addition, we reserve at all times all rights and remedies available to us with respect to such activities at law or in equity.</p>\n<h2>Reporting violations</h2>\n<p>If you have discovered and would like to report a violation of this Policy, please contact us immediately. We will investigate the situation and provide you with full assistance.</p>\n<h2>Changes and amendments</h2>\n<p>We reserve the right to modify this Policy or its terms related to the Services at any time at our discretion. When we do, we will revise the updated date at the bottom of this page. We may also provide notice to you in other ways at our discretion, such as through the contact information you have provided.</p>\n<p>An updated version of this Policy will be effective immediately upon the posting of the revised Policy unless otherwise specified. Your continued use of the Services after the effective date of the revised Policy (or such other act specified at that time) will constitute your consent to those changes.</p>\n<h2>Acceptance of this policy</h2>\n<p>You acknowledge that you have read this Policy and agree to all its terms and conditions. By accessing and using the Services you agree to be bound by this Policy. If you do not agree to abide by the terms of this Policy, you are not authorized to access or use the Services.</p>\n<h2>Contacting us</h2>\n<p>If you have any questions, concerns, or complaints regarding this Policy, we encourage you to contact us using the details below:</p>\n<p><a href=\"https://www.fitlynk.com/contact-us\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https://www.fitlynk.com/contact-us</a></p>\n<p>This document was last updated on June 23, 2022</p>', '&lt;h1&gt;Acce