(2297, 'dmca_policy', '', '<h1>DMCA policy</h1>\n<p>This Digital Millennium Copyright Act policy (Policy) applies to the <a href=\"https://www.fitlynk.com\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">fitlynk.com</a> website (Website), FitLynk mobile application (Mobile Application) and any of their related products and services (collectively, Services) and outlines how FitLynk FZ-LLC (doing business as FitLynk, we, us or our). addresses copyright infringement notifications and how you (you or your) may submit a copyright infringement complaint.</p>\n<p>Protection of intellectual property is of utmost importance to us and we ask our users and their authorized agents to do the same. It is our policy to expeditiously respond to clear notifications of alleged copyright infringement that comply with the United States Digital Millennium Copyright Act (DMCA) of 1998, the text of which can be found at the U.S. Copyright Office <a href=\"https://www.copyright.gov\" target=\"_blank\" rel=\"noopener noreferrer\">website</a>.</p>\n<h2>What to consider before submitting a copyright complaint</h2>\n<p>Before submitting a copyright complaint to us, consider whether the use could be considered fair use. Fair use states that brief excerpts of copyrighted material may, under certain circumstances, be quoted verbatim for purposes such as criticism, news reporting, teaching, and research, without the need for permission from or payment to the copyright holder. If you have considered fair use, and you still wish to continue with a copyright complaint, you may want to first reach out to the user in question to see if you can resolve the matter directly with the user.</p>\n<p>Please note that under 17 U.S.C.  512(f), you may be liable for any damages, including costs and attorneys fees incurred by us or our users, if you knowingly misrepresent that the material or activity is infringing. If you are unsure whether the material you are reporting is in fact infringing, you may wish to contact an attorney before filing a notification with us.</p>\n<p>We may, at our discretion or as required by law, share a copy of your notification or counter-notification with third parties. This may include sharing the information with the account holder engaged in the allegedly infringing activity or for publication. If you are concerned about your information being forwarded, you may wish to <a href=\"https://www.copyrighted.com/professional-takedowns\" target=\"_blank\" rel=\"noopener noreferrer\">use an agent</a> to report infringing material for you.</p>\n<h2>Notifications of infringement</h2>\n<p>Filing a DMCA complaint is the start of a pre-defined legal process. Your complaint will be reviewed for accuracy, validity, and completeness. Our response may include the removal or restriction of access to allegedly infringing material as well as a permanent termination of repeat infringers accounts.</p>\n<p>If we remove or restrict access to materials or terminate an account in response to a Notification of alleged infringement, we will make a good faith effort to contact the affected user with information concerning the removal or restriction of access, which may include a full copy of your Notification (including your name, address, phone, and email address), along with instructions for filing a counter-notification.</p>\n<h2>Counter-notifications</h2>\n<p>A user who receives a copyright infringement Notification may make a counter-Notification pursuant to sections 512(g)(2) and (3) of the US Copyright Act. If you receive a copyright infringement Notification, it means that the material described in the Notification has been removed from our Services or access to the material has been restricted. Please take the time to read through the Notification, which includes information on the Notification we received.</p>\n<p>Please note that you may be liable for, including costs and attorneys fees incurred by us or our users, if you knowingly misrepresent that the material or activity is not infringing the copyrights of others or that the material or activity was removed or restricted by mistake or misidentification. Accordingly, if you are not sure whether certain material infringes the copyrights of others or that the material or activity was removed or restricted by mistake or misidentification, you may wish to contact an attorney before filing a counter-notification.</p>\n<p>Notwithstanding anything to the contrary contained in any portion of this Policy, FitLynk reserves the right to take no action upon receipt of a counter-notification. If we receive a counter-notification that complies with the terms of 17 U.S.C.  512(g), we may forward it to the person who filed the original Notification.</p>\n<p>The process described in this Policy does not limit our ability to pursue any other remedies we may have to address suspected infringement.</p>\n<h2>Changes and amendments</h2>\n<p>We reserve the right to modify this Policy or its terms related to the Services at any time at our discretion. When we do, we will revise the updated date at the bottom of this page. We may also provide notice to you in other ways at our discretion, such as through the contact information you have provided.</p>\n<p>An updated version of this Policy will be effective immediately upon the posting of the revised Policy unless otherwise specified. Your continued use of the Services after the effective date of the revised Policy (or such other act specified at that time) will constitute your consent to those changes.</p>\n<h2>Reporting copyright infringement</h2>\n<p>If you would like to notify us of the infringing material or activity, we encourage you to contact us using the details below:</p>\n<p><a href=\"https://www.fitlynk.com/contact-us\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">https://www.fitlynk.com/contact-us</a></p>\n<p>This document was last updated on June 23, 2022</p>', '&lt;h1&gt;DMCA policy&lt;/h1&gt; <br>&lt;p&gt;This