(2298, 'disclaimer', '', '<h1>Disclaimer</h1>\n<p>This disclaimer (Disclaimer) sets forth the general guidelines, disclosures, and terms of your use of the <a href=\"https://www.fitlynk.com\" target=\"_blank\" rel=\"nofollow noopener noreferrer\">fitlynk.com</a> website (Website), FitLynk mobile application (Mobile Application) and any of their related products and services (collectively, Services). This Disclaimer is a legally binding agreement between you (User, you or your) and FitLynk FZ-LLC (doing business as FitLynk, we, us or our). If you are entering into this agreement on behalf of a business or other legal entity, you represent that you have the authority to bind such entity to this agreement, in which case the terms User, you or your shall refer to such entity. If you do not have such authority, or if you do not agree with the terms of this agreement, you must not accept this agreement and may not access and use the Services. By accessing and using the Services, you acknowledge that you have read, understood, and agree to be bound by the terms of this Disclaimer. You acknowledge that this Disclaimer is a contract between you and FitLynk, even though it is electronic and is not physically signed by you, and it governs your use of the Services.</p>\n<h2>Representation</h2>\n<p>Any views or opinions represented on the Services belong solely to the content creators and do not represent those of people, institutions or organizations that FitLynk or creators may or may not be associated with in professional or personal capacity, unless explicitly stated. Any views or opinions are not intended to malign any religion, ethnic group, club, organization, company, or individual.</p>\n<h2>Content and postings</h2>\n<p>You may print or copy any part of the Services for your personal or non-commercial use.</p>\n<p>You may submit new content and comment on the existing content on the Services. By uploading or otherwise making available any information to FitLynk, you gra