INSERT INTO `wo_langs_bak` (`id`, `lang_key`, `type`, `english`, `arabic`, `dutch`, `french`, `german`, `italian`, `portuguese`, `russian`, `spanish`, `turkish`) VALUES
(2219, 'privacy_policy_page', '', '&lt;h2&gt;Who we are?&lt;/h2&gt; <br>      Provide name and contact details of the data controller. This will typically be your business or you, if you are a sole trader. Where applicable, you should include the identity and contact details of the controllers representative and/or the data protection officer. <br> <br>      &lt;h2&gt;What information do we collect?&lt;/h2&gt; <br>      Specify the types of personal information you collect, eg names, addresses, user names, etc. You should include specific details on: <br>      how you collect data (eg when a user registers, purchases or uses your services, completes a contact form, signs up to a newsletter, etc) <br>      what specific data you collect through each of the data collection method <br>      if you collect data from third parties, you must specify categories of data and source <br>      if you process sensitive personal data or financial information, and how you handle this <br>      &lt;br&gt;&lt;br&gt; <br>      You may want to provide the user with relevant definitions in relation to personal data and sensitive personal data. <br>      &lt;br&gt;&lt;br&gt; <br>      &lt;h2&gt;How do we use personal information?&lt;/h2&gt; <br>      Describe in detail all the service- and business-related purposes for which you will process data. For example, this may include things like: <br>      personalisation of content, business information or user experience <br>      account set up and administration <br>      delivering marketing and events communication <br>      carrying out polls and surveys <br>      internal research and development purposes <br>      providing goods and services <br>      legal obligations (eg prevention of fraud) <br>      meeting internal audit requirements <br>      &lt;br&gt;&lt;br&gt; <br>      Please note this list is not exhaustive. You will need to record all purposes for which you process personal data. <br>      &lt;br&gt;&lt;br&gt; <br>      &lt;h2&gt;What legal basis do we have for processing your personal data?&lt;/h2&gt; <br>      Describe the relevant processing conditions contained within the GDPR. There are six possible legal grounds: <br>      consent <br>      contract <br>      legitimate interests <br>      vital interests <br>      public task <br>      legal obligation <br>      &lt;br&gt;&lt;br&gt; <br>      Provide detailed information on all grounds that apply to your processing, and why. If you rely on consent, explain how individuals can withdraw and manage their consent. If you rely on legitimate interests, explain clearly what these are. <br>      &lt;br&gt;&lt;br&gt; <br>      If youre processing special category personal data, you will have to satisfy at least one of the six processing conditions, as well as additional requirements for processing under the GDPR. Provide information on all additional grounds that apply. <br>      &lt;br&gt;&lt;br&gt; <br>      &lt;h2&gt;When do we share personal data?&lt;/h2&gt; <br>      Explain that you will treat personal data confidentially and describe the circumstances when you might disclose or share it. Eg, when necessary to provide your services or conduct your business operations, as outlined in your purposes for processing. You should provide information on: <br>      how you will share the data <br>      what safeguards you will have in place <br>      what parties you may share the data with and why <br> <br>      &lt;h2&gt;Where do we store and process personal data?&lt;/h2&gt; <br>      If applicable, explain if you intend to store and process data outside of the data subjects home country. Outline the steps you will take to ensure the data is processed according to your privacy policy and the applicable law of the country where data is located. <br> <br>      If you transfer data outside the European Economic Area, outline the measures you will put in place to provide an appropriate level of data privacy protection. Eg contractual clauses, data transfer agreements, etc. <br> <br>      &lt;h2&gt;How do we secure personal data?&lt;/h2&gt; <br>      Describe your approach to data security and the technologies and procedures you use to protect personal information. For example, these may be measures: <br>      to protect data against accidental loss <br>      to prevent unauthorised access, use, destruction or disclosure <br>      to ensure business continuity and disaster recovery <br>      to restrict access to personal information <br>      to conduct privacy impact assessments in accordance with the law and your business policies <br>      to train staff and contractors on data security <br>      to manage third party risks, through use of contracts and security reviews <br>      &lt;br&gt;&lt;br&gt; <br>      Please note this list is not exhaustive. You should record all mechanisms you rely on to protect personal data. You should also state if your organisation adheres to certain accepted standards or regulatory requirements. <br>      &lt;br&gt;&lt;br&gt; <br>      &lt;h2&gt;How long do we keep your personal data for?&lt;/h2&gt; <br>      Provide specific information on the length of time you will keep the information for in relation to each processing purpose. The GDPR requires you to retain data for no longer than reasonably necessary. Include details of your data or records retention schedules, or link to additional resources where these are published. <br>      &lt;br&gt;&lt;br&gt; <br>      If you cannot state a specific period, you need to set out the criteria you will apply to determine how long to keep the data for (eg local laws, contractual obligations, etc) <br>      &lt;br&gt;&lt;br&gt; <br>      You should also outline how you securely dispose of data after you no longer need it. <br>      &lt;br&gt;&lt;br&gt; <br>      &lt;h2&gt;Your rights in relation to personal data&lt;/h2&gt; <br>      Under the GDPR, you must respect the right of data subjects to access and control their personal data. In your privacy notice, you must outline their rights in respect of: <br>      access to personal information <br>      correction and deletion <br>      withdrawal of consent (if processing data on condition of consent) <br>      data portability <br>      restriction of processing and objection <br>      lodging a complaint with the Information Commissioners Office <br> <br>      You should explain how individuals can exercise their rights, and how you plan to respond to subject data requests. State if any relevant exemptions may apply and set out any identity verifications procedures you may rely on. <br> <br>      Include details of the circumstances where data subject rights may be limited, eg if fulfilling the data subject request may expose personal data about another person, or if youre asked to delete data which you are required to keep by law. <br> <br>      &lt;h2&gt;Use of automated decision-making and profiling&lt;/h2&gt; <br>      Where you use profiling or other automated decision-making, you must disclose this in your privacy policy. In such cases, you must provide details on existence of any automated decision-making, together with information about the logic involved, and the likely significance and consequences of the processing of the individual. <br> <br>      &lt;h2&gt;How to contact us?&lt;/h2&gt; <br>      Explain how data subject can get in touch if they have questions or concerns about your privacy practices, their personal information, or if they wish to file a complaint. Describe all ways in which they can contact you  eg online, by email or postal mail. <br>      &lt;br&gt;&lt;br&gt; <br>      If applicable, you may also include information on: <br>      &lt;br&gt;&lt;br&gt; <br>      &lt;h2&gt;Use of cookies and other technologies&lt;/h2&gt; <br>      You may include a link to further information, or describe within the policy if you intend to set and use cookies, tracking and similar technologies to store and manage user preferences on your website, advertise, enable content or otherwise analyse user and usage data. Provide information on what types of cookies and technologies you use, why you use them and how an individual can control and manage them. <br>      &lt;br&gt;&lt;br&gt; <br>      Linking to other websites / third party content <br>      If you link to external sites and resources from your website, be specific on whether this constitutes endorsement, and if you take any responsibility for the content (or information contained within) any linked website. <br>      &lt;br&gt;&lt;br&gt; <br>      You may wish to consider adding other optional clauses to your privacy policy, depending on your business circumstances.', '', '', '', '', '', '', '', '', ''),
