(6, 485, 0, 'Isopure, Zero Carb, Protein Powder, Cookies &amp; Cream, 3 lb (1.36 kg)', 'Description <br>Artificially Flavored <br>Added Vitamin &amp; Mineral Blend  <br>With 25 Grams of Protein From 100% Whey Protein Isolate <br>Quality protein. zero carbs. pure results. <br> <br>25 grams of delicious 100% pure, rBST free!, whey protein isolate with not a carb in sight. 100% whey protein isolate means exceptional purity and quality: excess fat, cholesterol, sugars, carbs, lactose and other fillers <br>are removed to give you everything you need and nothing you don&#039;t. And each serving delivers 5.5 grams of naturally occurring BCAAs, 4 grams of naturally occurring glutamine and an added vitamin and mineral blend <br>to help you meet your micronutrient needs.', 2, '', '20', 'United Arab Emirates', 0, '0', '10', '35.929996', '31.9828121', 993, 1664352823, '1'),
